import React from 'react';
import { Link } from 'react-router-dom';

function Navigation({ authUser, signOut }) {
  const {id, avatar, name} = authUser;

  return (
    <div className='navigation'>
      <nav>
        <Link to="/">Home</Link>
      </nav>
    </div>
  )
}
